Pussel Maria Del Carmen tycker om att pussla. Varför vill vi se det? Maria (María Onetto) är en till utseendet uttråkad hemmafru med två vuxna söner som fortfarande glider omkring hemma. Hennes karl är en flörtande charmör som jobbar dagtid och förväntar sig middag och ett rent hus när han kommer hem. Så på Marias födelsedag, som hon spenderar med att passa upp på gästerna iförd förkläde och stresstålighet sker något magiskt. Eller något som borde varit magiskt för att hålla filmen vid liv… Mari
..........
) är alldeles för nöjd i det gamla? Svåra frågeställningar som presenteras här tillsammans med några faktiska mer intrigerande ingredienser. Marias lojalitet utmanas. Ja det var nog bara det förresten. Pussel är, och kommer förbli en av de segaste filmerna jag sett under en väldigt lång tid. Den är fint filmad, lite mysig sådär och det är lätt att känna sig välkommen i Marias hem. Men María Onetto, som inte förutom vid ett fåtal tillfällen visar något bevis för att hon inte är en robot skapar en
